import '../App.css';
import Posst from './post';
import './Posts.css';


function Postt() {
return (
    <div className='posts'>
        <Posst />
        <Posst />
        <Posst />
        <Posst />
        <Posst />
        <Posst />
    </div>
  );
}

export default Postt;
